import { connect } from 'react-redux';
import WithRouterAdminPersonalAccountRows from './WithRouterAdminPersonalAccountRowsComponent';
import DELETE from '../../../redux/actions/loginPersonalAccountActions';

const ConnectedAdminPersonalAccountRows = connect(
  (state) => ({
    pages: state,
  }),
  (dispatch) => ({
    onDelete: () => dispatch({
      type: DELETE.type,
    }),
  }),
)(WithRouterAdminPersonalAccountRows);

export default ConnectedAdminPersonalAccountRows;
